import React, {useState} from "react";




const BudgetHistory = () => {
    const [stockName, setStockName] = useState("씨젠");
    const [price, setPrice] = useState(
        "310,600");
    const [change, setChange] = useState("+32,000");
    const [changePercentage, setChangePercentage] = useState("+11.84%");
    const [marketCap, setMarketCap] = useState("79,923(억)")
    const [volumeCurrency, setVolumeCurrency] = useState("43,589,400")
    const [arr, setArr] = useState([
        {
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },
        {
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        },{
            stockName : stockName,
            price: price,
            change: change,
            changePercentage: changePercentage,
            marketCap: marketCap,
            volumeCurrency: volumeCurrency
        }
    ])

    const linktoDetail = e => {
        e.preventDefault();
    }

    return <>
        <table className="table">
            <thead>
            <tr>
                <th>거래날짜</th>
                <th>종목</th>
                <th>거래 종류</th>
                <th>금액</th>
                <th>잔액</th>
            </tr>
            </thead>
            <tbody>
            {arr.map((item)=>(
                <tr onClick={linktoDetail}>
                    <td>{item.stockName}</td>
                    <td>{item.price}</td>
                    <td>{item.change}</td>
                    <td>{item.changePercentage}</td>
                    <td>{item.marketCap}</td>
                    <td>{item.volumeCurrency}</td>
                </tr>
            ))}
            </tbody>
        </table>
    </>
}

export default BudgetHistory;
